                                    <li>platform (seperti APLIKASI MITRA DARAT Play)</li>
                                    <li>layanan terintegrasi (seperti Maps yang disematkan di aplikasi atau situs perusahaan lain)</li>
                                    <li>perangkat (seperti APLIKASI MITRA DARAT Home)</li>
                                 </ul>
                                 <h3 id="footnote-trademark">merek dagang</h3>
                                 <p>Simbol, nama, dan gambar yang digunakan dalam perdagangan yang dapat membedakan antara barang atau layanan suatu individu atau organisasi dan barang atau layanan individu atau organisasi lainnya.</p>
                                 <h3 id="footnote-organization">organisasi</h3>
                                 <p>Entitas hukum (seperti perusahaan, non-profit, atau sekolah) dan bukan orang individu.</p>
                                 <h3 id="footnote-business-user">pengguna bisnis</h3>
                                 <p>Individu atau entitas yang bukan merupakan konsumen (lihat konsumen).</p>
                                 <h3 id="footnote-eu-platform-to-business">Peraturan Platform-ke-Bisnis EU</h3>
                                 <p>Peraturan (EU) 2019/1150 tentang mempromosikan keadilan dan transparansi bagi pengguna bisnis layanan perantaraan online.</p>
                                 <h3 id="footnote-indemnify">perlindungan terhadap kerugian</h3>
                                 <p>Kewajiban kontrak individu atau organisasi untuk mengompensasi kerugian yang diderita oleh individu atau organisasi lain dari proses hukum seperti tuntutan hukum.</p>
                                 <h3 id="footnote-disclaimer">pernyataan penyangkalan</h3>
                                 <p>Pernyataan yang membatasi tanggung jawab hukum seseorang.</p>
                                 <h3 id="footnote-country-version">versi negara</h3>
                                 <p>Jika Anda memiliki Akun APLIKASI MITRA DARAT, kami mengaitkan akun Anda dengan suatu negara (atau wilayah) agar kami dapat menentukan:</p>
                                 <ul>
                                    <li><a class="UADm2d" href="terms/definitions?hl=id#toc-terms-affiliates">afiliasi</a> APLIKASI MITRA DARAT yang menyediakan <a class="UADm2d" href="terms/definitions?hl=id#toc-terms-services">layanan</a> untuk Anda dan yang memproses informasi Anda saat Anda menggunakan layanan tersebut</li>
                                    <li>versi persyaratan yang mengatur hubungan antara Anda dan APLIKASI MITRA DARAT</li>
                                 </ul>
                                 <p>Saat Anda logout, versi negara Anda ditentukan oleh lokasi tempat Anda menggunakan layanan APLIKASI MITRA DARAT. Jika memiliki akun, Anda dapat <a href="https://accounts.SIDOARUM.com/ServiceLogin?hl=id&amp;continue=https://policies.SIDOARUM.com/terms?hl%3Did">login</a> dan melihat persyaratan ini untuk melihat negara yang dikaitkan dengan akun.</p>
